import React from 'react'
import st from './Users.module.css'
import User from "./User";

const Users = (props) => {

    let onClickNextHandler = () => {
        props.showNextUsers()
    }

    let onClickLastHandler = () => {
        props.showLastUsers()
    }

    return (
        <div className={st.users}>
            <div>
                <div className={st.whole_style}>
                   <User users={props.users.slice(props.startPosition, props.startPosition + props.pagingSize -1)}/>
                </div>
            </div>
            <div>
                <button onClick={onClickNextHandler}>Last</button>
                <button onClick={onClickLastHandler}>Next</button>
            </div>
        </div>

    )

}

export default Users
